import { useDispatch } from "react-redux";

export const deleteFromBooks = (curBooks, bookDelete) => {
	const dispatch = useDispatch();
	const updatedBooks = deleteBook(curBooks, bookDelete);
	dispatch(setCurBooks(updatedBooks));
};
